	function play(id){
		var textnode, flag = true;
			textnode = document.getElementById(id);
			function changeText()
			{
				textnode.style.fill = 'red';
				textnode.style.fontWeight = 'bold';
			}
			
			function restoreText()
			{
				textnode.style.fill = 'blue';
				textnode.style.fontWeight = 'normal';
			}
			
			var play = setInterval(function(){
				if(flag){
				  changeText();
				  flag = false
				}else{
				  restoreText()
				  flag = true;
				}
			}, 200)
	}
